import boto3
import time
import cfnresponse
import logging
cfn = boto3.client('cloudformation')

# https://issues.amazon.com/issues/Provisioner-981
def lambda_handler(event, context):
    logger = logging.getLogger()
    logger.setLevel(logging.INFO)
    try:
        if event['RequestType'] == 'Delete':
            logger.info('Deleted!')
            cfnresponse.send(event, context, cfnresponse.SUCCESS, {})
            return
        props = event['ResourceProperties']
        name = props['TypeName']
        try:
            versions=cfn.list_type_versions(Type='RESOURCE', TypeName=name, MaxResults=90)['TypeVersionSummaries'][:-10]
        except Exception:
            versions=[]
        for vId in map(lambda vSum: vSum['VersionId'], versions):
            try:
                cfn.deregister_type(Type='RESOURCE', TypeName=name, VersionId=vId)
            except Exception:
                logger.error('Cant deregister version ' + vId)

        for attempt in range(3):
            try:
                response = cfn.register_type(
                    Type='RESOURCE',
                    TypeName=name,
                    SchemaHandlerPackage=props['S3Url'],
                    LoggingConfig={
                        'LogRoleArn': props['LogRoleArn'],
                        'LogGroupName': props['LogGroupName']
                    }
                )
                break
            except Exception as e:
                if attempt > 1:
                    raise e
                logger.exception('Registration failure. Waiting 5 seconds before re-try')
                time.sleep(5)

        reg_token = response['RegistrationToken']
        describe_response = cfn.describe_type_registration(RegistrationToken = reg_token)
        while describe_response['ProgressStatus'] == "IN_PROGRESS":
            time.sleep(5)
            describe_response = cfn.describe_type_registration(RegistrationToken = reg_token)
        status = describe_response['ProgressStatus']
        if status == "FAILED":
            cfnresponse.send(event, context, cfnresponse.FAILED, {})

        if ((status == "COMPLETE") or (status == "COMPLETED")) and ('TypeVersionArn' in describe_response):
            version_id = describe_response['TypeVersionArn'].split('/')[-1]
            dv_response = cfn.set_type_default_version(
                Type='RESOURCE',
                TypeName=name,
                VersionId=version_id
            )
        else:
            logger.info('Didnt set default version because of ' + str(describe_response))

        logger.info(name + ' type registered.')
        cfnresponse.send(event, context, cfnresponse.SUCCESS, {})
    except Exception:
        logger.exception('Signaling failure to CloudFormation.')
        cfnresponse.send(event, context, cfnresponse.FAILED, {})
